const App2 = () => {

    let [count, setCount] = useState(0);
    let [item, setItem] = useState(0);

  return (
    <>
        <br />
        <br />
        <button>Increse Count</button>
        <button>Increse Item</button>
        <br />
        <h1>Count ---- {count}</h1>
        <h1>Item ---- {item}</h1>
    </>
  )
}

export default App2
